
import math


def plotpointFromSTR(strg):
    arr = strg.split(",");
    x = [];
    y = [];
    for i in arr:
        hld = i.split("&")
        print("oh ya" + str(hld))
        x.append(hld[0]);
        y.append(hld[1]);
    plotPointFromTwoArr(x,y)

def plotpointFromSTR2(strg):
    arr = strg.splitlines();
    points = "";
    for i in arr:
        hld = i.split("&")
        print(hld)
        x = hld[0];
        ys = hld[1].split(",");
        for j in range(len(ys)-1):
            points += f"({x},{ys[j]})";
        points += f"\n"
    print(points)


def plotPointFromTwoArr(x,y):
    prnt = "";
    for i in range(len(x)):
        prnt += "(" + str(x[i])+","+str(y[i])+")\n";
    print(prnt);

def plot(dom,domStep,f):
    i = dom[0];
    x = [];
    y = []
    while i <= dom[1]:
        x.append(i);
        y.append(f(i));
        i += domStep;
    return [x,y];

